export default function CalendarItem(props) {
  return (
    <div
      className={
        "absolute bg-" +
        props.color +
        "-500 border-l-2 border-" +
        props.color +
        "-700 text-" +
        props.color +
        "-700"
      }
    >
      <h3>{props.title}</h3>
      <h4>
        <span>
          <FaUserAlt />
          {props.professor}
        </span>
      </h4>
      <h4>
        <span>{props.location}</span>
      </h4>
    </div>
  );
}
